import { AppBar, IconButton, Toolbar, Typography } from "@material-ui/core";

import React from "react";
import HomeIcon from "@mui/icons-material/Home";

const Header = () => {
  return (
    <AppBar>
      <Toolbar>
        <Typography>Test Builder</Typography>
        <IconButton>
          <HomeIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
